import {
  PairList,
  PairOne,
  PairTwo
} from "./screens";

const routes = [
  {
    key: "PairList",
    exact: true,
    path: "/ACOM-AGOV/pairs",
    component: PairList,
  },
  {
    key: "PairOne",
    exact: true,
    path: "/ACOM-AGOV/ETH",
    component: PairOne,
  },
  {
    key: "PairTwo",
    exact: true,
    path: "/ACOM-AGOV/BNB",
    component: PairTwo,
  }
];

export default routes;
